import React, { Component } from 'react'

export default class Nav extends Component {

    constructor(props) {
        super(props);

        this.state = {
            email: '',
            password: '',
            errorToggle: false,
            errorMessage: '',
            isAuth: false,
            loggedInEmail: ''
        }


    } 

    handleInputOnChange = (event) => {

        this.setState({
            [event.target.name]: event.target.value
        })

    }

    handleInputSubmit = (event) => {
        event.preventDefault(); 
        // apiAuth({
