        // })
    }
    render() {
        return (
				<nav class="navbar navbar-expand-lg navbar-light bg-light rounded mt-5">
				  <a class="navbar-brand" href="#">Pokemon</a>
				  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
				    <span class="navbar-toggler-icon"></span>
				  </button>
				  <div class="collapse navbar-collapse" id="navbarSupportedContent">
				    <ul class="navbar-nav mr-auto">
				      <li class="nav-item active">
				        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
				      </li>
				    </ul>
				    <form class="form-inline my-2 my-lg-0">
				    	<div class="col-auto pl-0">
					      <div class="input-group">
					        <div class="input-group-prepend">
					          <div class="input-group-text"><i class="fa fa-user"></i></div>
					        </div>
					        <input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Email Address"></input>
					      </div>
					    </div>
					    <div class="col-auto pl-0">
					      <div class="input-group">
					        <div class="input-group-prepend">
					          <div class="input-group-text"><i class="fa fa-lock"></i></div>
					        </div>
					        <input type="password" class="form-control" id="inlineFormInputGroup" placeholder="Password"></input>
					      </div>
					    </div>
					    <div class="col-auto pl-0 pr-0">
				      		<button class="btn btn-primary my-2 my-sm-0" type="submit">Login</button>
				      	</div>
				    </form>
				  </div>
				</nav>	
        )
    }
}
